import './Header.css';
import image from './TAHAR.png';
import { Link } from 'react-router-dom';
import React, { useState, useEffect } from 'react';
import '../../dist/output.css';

const Header = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  // Close the mobile menu when the screen size changes to desktop
  const handleResize = () => {
    if (window.innerWidth >= 768) {
      setIsMobileMenuOpen(false);
    }
  };

  // Add a resize event listener to handle the screen size change
  useEffect(() => {
    window.addEventListener('resize', handleResize);
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  //   document.addEventListener("DOMContentLoaded", function () {
  //     const toggleButton = document.querySelector(".toggle-button");
  //     const slideInDiv = document.querySelector(".custom-menu-slide");

  //     let isOpen = false;

  //     toggleButton.addEventListener("click", function () {
  //         if (!isOpen) {
  //             slideInDiv.style.animation = "slideIn 1s forwards";
  //         } else {
  //             slideInDiv.style.animation = "slideOut 1s forwards";
  //         }

  //         isOpen = !isOpen;
  //     });
  // });

  return (
    <header className="bg-blue-900 text-white">
      <div className="mx-5 flex items-center justify-between">
        <Link to="/">
          <img className="w-32  md:mt-5 rounded-full" src={image} alt="LOGO" />
        </Link>
        <p className='ml-5 lg:text-4xl md:text-2xl'>Tahar Garage Door Repair Services</p>


        <div className="md:flex justify-between py-4 text-center">
          <a
            className="w-32 mr-4 ml-2 mb-2 md:my-0 bg-red-600 hover:bg-green-600 text-white py-2 px-4 rounded-lg inline-block md:w-32"
            href="tel:661-202-8255"
          >
            Call Now For A Free Quote! 661-202-8255
          </a>
        </div>
        {/* Show the button only on screens the size of a mobile device */}
        <button
          className="md:hidden bg-blue-500 hover:bg-blue-600 text-white px-2 py-1 rounded-lg toggle-button"
          onClick={toggleMobileMenu}
        >
          {isMobileMenuOpen ? 'Close' : 'Menu'}
        </button>
      </div>

      {/* Show the mobile menu on screens the size of a mobile device */}
      {isMobileMenuOpen && (
        <div className="absolute bg-blue-400 container mx-auto py-4 text-center custom-menu-slide">
          <ul className="space-y-2">
            <li>
              <Link
                className="hover:text-blue-300"
                to="/about"
                onClick={toggleMobileMenu}
              >
                About Us
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/reviews"
                onClick={toggleMobileMenu}
              >
                Reviews
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/services"
                onClick={toggleMobileMenu}
              >
                Services
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/gallery"
                onClick={toggleMobileMenu}
              >
                Gallery
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/faq"
                onClick={toggleMobileMenu}
              >
                FAQ
              </Link>
            </li>
            <li>
              <Link
                className="hover:text-blue-300"
                to="/contact"
                onClick={toggleMobileMenu}
              >
                Contact
              </Link>
            </li>
          </ul>
        </div>
      )}

      <nav className="hidden md:block space-x-4 text-center">
        <Link className="hover:text-blue-300 custom-nav-css" to="/about">
          About Us
        </Link>
        <Link className="hover:text-blue-300 custom-nav-css" to="/reviews">
          Reviews
        </Link>
        <Link className="hover:text-blue-300 custom-nav-css" to="/services">
          Services
        </Link>
        <Link className="hover:text-blue-300 custom-nav-css" to="/gallery">
          Gallery
        </Link>
        <Link className="hover:text-blue-300 custom-nav-css" to="/faq">
          FAQ
        </Link>
        <Link className="hover:text-blue-300 custom-nav-css" to="/contact">
          Contact
        </Link>
      </nav>



    </header>
  );
};

export default Header;
